import {maps} from "../controller/maps"
import { maps2 } from "../notes"

export function Cities(){
  var listCity = []
  for (let city of maps2) {
      for (let cty of city.neighbor_cities) {
        listCity.push(
          {
            "startCity" : city.city_name,
            "finishCity" : cty.city_name,
            "distance" : cty.distance
          }
        )
      }
  }
  return(
    <center>
      <h1>Cities</h1>
      {
        listCity.map(function(city){
          return (
          <h5>
            [
              "start city" ={'>'} "{city.startCity}",
              "finish city" ={'>'} "{city.finishCity}",
              "distance" ={'>'} {city.distance}
            ],
          </h5>)
        })
      }
    </center>
  )
}
